import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Login from './components/Login';
import TasksPage from './components/TasksPage';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={Login} />
        <Route path="/tasks" component={TasksPage} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
